import React from 'react';
import { Link } from 'react-router-dom';
import FormularioLogin from '../components/FormularioLogin';
// Importe seu CSS global se ainda não estiver importado no seu index.js ou App.js
// import './Global.css'; // OU import 'caminho/para/o/seu/Global.css';

const Login = () => {
    return (
        // Use a classe 'apresentacao' para o container principal
        // Isso já traz 'display: flex', 'align-items', 'justify-content', etc. do CSS
        <main className="apresentacao"> 
            <section className="apresentacao__conteudo" style={{ maxWidth: 'unset' }}> {/* Remova o max-width aqui se precisar */}
                <h1 className="apresentacao__conteudo__titulo">
                    Faça seu <strong className="titulodestaque">Login!</strong>
                </h1>

                <FormularioLogin />
                <p style={{ marginTop: '20px', textAlign: 'center', width: '100%' }}> {/* Centralize o texto do parágrafo */}
                    Não tem cadastro? <Link to="/cadastro">Cadastre-se aqui</Link>
                </p>
            </section>
            <img 
                src="/assets/ia.png" 
                alt="Unicórnio" 
                className="apresentacao_imagem"
            />
        </main>
    );
};

export default Login;
